export class Card {
  constructor() {
    this.cardName = "";
    this.cardSprite = null;
    this.cardAccessorySprite = null;
    this.Accuracy = 0;
    this.Retaliation = 0;
    this.Damage = 0;
    this.HealthPoints = 0;
    this.abilityRarity = AbilityRarity.Common;
    this.Trigger = "";
    this.Effect = "";
  }
}

export const AbilityRarity = {
  Common: 'Common',
  Uncommon: 'Uncommon',
  Rare: 'Rare'
};

export class TextAndWeight {
  constructor(text, weight) {
    this.Text = text;
    this.Weight = weight;
  }
}
